import React from 'react';
import ReactDOM from 'react-dom';

class StudentList extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <p>Student Data{props.rowId}</p>             


            </div>
        );

    }
}

export default StudentList;
